import React from "react";
import ReactEcharts from 'echarts-for-react';
import {Table} from 'antd';
export default class TicketTypes extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
           
        };
    }
  getOption = () => {
		const datasource = [
			{
				key: '1',
				rank: 1,
				address: '北京市',
				num: 500,
			  },
			  {
				key: '2',
				rank: 1,
				address: '山东省',
				num: 450,
			  }
		];
		const columns = [
		  {
			title: '排名',
			dataIndex: 'rank',
			key: 'rank',
		  },
		  {
			title: '地区',
			dataIndex: 'address',
			key: 'address',
		  },
		  {
			title: '数量',
			dataIndex: 'num',
			key: 'num',
		  },
		];
	}
    render() {
        return (
			<Table dataSource={this.dataSource} columns={this.columns} style={{width:'50%',height:'2em',color:'blue'}}/>
        )
    }
}
